INSERT INTO `news` (`id`, `art`, `text`, `titel`, `username`, `datum`, `lastchange`) VALUES
(1, 4, 'Eingabemaske Arbeitskarte:\nRückwandtor zu Öffnungen Rückwand.\nWenn Rückwandtor eingetragen, Fenster und Tür auf disable stellen und Einträge löschen.\nTor immer 225 breit und 200 hoch.\nBestellmaß unter RW mit Breite X Höhe. \nIn Skizze Lüftungsöffnungen ausblenden\n', 'Rückwandtor zu Öffnungen Rückwand', 'Martin', 1614000591, 1614084847),
(2, 4, 'Fehlen in Skizze. Standartfarbe muss eingetragen werden', 'Farbe Tür und Fenster fehlt', 'Martin', 1614001158, 1614082983),
(3, 4, 'In Skizze Entfall von Loch Boden ankreuzen, wenn Auslass RW oder SW', 'Skizze Entfall Loch Boden', 'Martin', 1614001247, 1614071387),
(4, 3, 'In Skizze Zeile leer lassen, wenn kein Strompaket.\nWenn in Garage in Produktion, Mail an Elektriker.\nNur wenn Haken in Stammblatt drin, Elektropaket\n\n(Ist das mit der Mail getestet? Ich würde das aber noch nicht scharf stellen. Erst wenn die Produktionsplanung läuft)', 'Strompaket', 'Martin', 1614001290, 1614082857),
(5, 4, 'Für Admin keine Sperre in Eingabemaske Arbeitskarte. Das Schloss wird aber angezeigt!!', 'Lock für Admin abschalten', 'Martin', 1614001375, 1614071380),
(6, 2, 'Kunden im Stammblatt hinzufügen, damit die Mailadresse ermittelt werden kann.\nZusätzlich Mailbutton für Mail versenden einblenden wenn Kunde eingetragen ist.\nTel, Mobil, Mail und hinzufügen.\nUnter was für einem Betreff und Text soll die Mail verschickt werden?\nMailbetreff, Mailtext und Bemerkung mit aufnehmen.\nWelche Absendermail? Individuell', 'Kunden hinzufügen', 'Martin', 1614011185, 1614072637),
(7, 1, 'Analog der bereits geschickten Excel Datei. Die Quelle wie wir sie verwenden bruachen wir dann nicht:\nWichtig ist die Jahresübersicht im Vergleich der Vorjahre.\nDie Monatsübersicht und die Übersicht je Vertreter.\nSoweit ich das beurteilen kann erfassen wir bereits alle notwendigen Daten. Sie müssen nur un Form gebracht werden. \n', 'Verkaufsstatistik', 'Arnold', 1614085674, 1614085674),
(8, 1, 'Für die Auftragsbestätigung und im Angebotsfall\n\n2 unterschiediche Texte als Ergänzung zum zur Skizze \nBeim Angebot muss ein Dummy Stammblatt angelegt werden damit kein Auftrag erzeugt wird.\nKönnen die Bilder Grundriss und Schnitte noch anders angeordnet werden?\nBesteht die Möglichkeit zumindest zwei oder 3 Garagen in der Übersicht zu Gruppieren? Das hätte Auswirkungen auf die Anordnung der jeweiligen Elemente.\n\nTexte kommen von AK', 'Übersichtsskizze an den Kunden', 'Arnold', 1614085851, 1614085947),
(9, 1, 'End/Mittel und Torgarage\nLage Elektro', 'Arbeitskarte Trias', 'Arnold', 1614086055, 1614086055);
