(1, 'Rechnung schreiben', 'Rechnung am 15.1 über 1000. Dann jeden weiteren Monatsanfang', 11, 4, 5, 1609974000, 1610665200, 1610804169),
(2, 'Definition Daten', '<h3>Wichtige Daten:</h3>\n\n<table border=\"1\" cellpadding=\"2\" cellspacing=\"0\" style=\"width:800px\">\n	<tbody>\n		<tr>\n			<td><strong>Art</strong></td>\n			<td><strong>Beschreibung</strong></td>\n			<td>Spalte</td>\n			<td><strong>Karte</strong></td>\n		</tr>\n		<tr>\n			<td>Angelegt</td>\n			<td>Auftrag wird angelegt</td>\n			<td>datuman</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>abgerufen</td>\n			<td>Auftrag wird vom Kunden abgerufen</td>\n			<td>datumab</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Produktion</td>\n			<td>Anfang der Produktion, Karte in in SPlan</td>\n			<td>datums</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Datum Boden</td>\n			<td>Garage geht in die Boden Produktion</td>\n			<td>datumb</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Datum Produktion</td>\n			<td>Garage geht in Produktionshalle</td>\n			<td>datump</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Liefertermin</td>\n			<td>Termin der Auslierung (ca. 14 Tag nach Produktionsstart)</td>\n			<td>datuml</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Ausgeliefert</td>\n			<td>Garage ausgeliefert</td>\n			<td>datumaus</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Wunschtermin</td>\n			<td>Wunschtermin des Kunden</td>\n			<td>datumw</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>T</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 5, 6, 5, 1609974000, 1617141600, 1610804181),
(3, 'Memosystem', '<p>Idee ist ein Memosystem, mit dem sich die Mitarbeiter Memos und aufgaben zustellen k&ouml;nnen.</p>\n', 40, 6, 1, 1609974000, 1617141600, 1610045663),
(4, 'Erinnerungssystem', '<p>Ein Erinnerungssystem, das den Mitarbeiter an t&auml;gliche Aufgaben erinnert. Z.B. welche Auftr&auml;ge heute f&auml;llig sind</p>\n', 40, 6, 1, 1609974000, 1617141600, 1610045675),
(5, 'Ablauf', '<h3>Wichtige Daten:</h3>\n\n<table border=\"1\" cellpadding=\"2\" cellspacing=\"0\" style=\"height:352px; width:800px\">\n	<tbody>\n		<tr>\n			<td><strong>Name</strong></td>\n			<td><strong>Trigger</strong></td>\n			<td>GP.</td>\n			<td>wer triggert</td>\n		</tr>\n		<tr>\n			<td>Auftrags Pool</td>\n			<td>Auftrag wird angelegt, manuell oder &uuml;ber WWP</td>\n			<td>X</td>\n			<td>WWP oder von Hand</td>\n		</tr>\n		<tr>\n			<td>Abruf Pool</td>\n			<td>Auftrag wird vom Kunden abgerufen</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Planung Schalung</td>\n			<td>Auftrag wird in Schalung eingeplant und produziert</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Boden Pool</td>\n			<td>Garage Schalung fertig</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Planung Boden</td>\n			<td>Auftrag an Bodentruppe</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Fertigung Pool</td>\n			<td>Garage Boden fertig</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Planung Fertigung</td>\n			<td>Auftrag an Fertigung</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Fertigstellung</td>\n			<td>Fertigstellung und Abnahme</td>\n			<td>X</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Auslieferung</td>\n			<td>Auslieferung an Kunde</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 5, 6, 2, 1609974000, 1617141600, 1610045790),
(6, 'Domain', '<p>Welche Domain(s) sollen wir nehmen?<br />\nAuch wenn das Tool nur lokal l&auml;uft w&auml;re eine Homepage sinnvoll...</p>\n\n<p>Frei:</p>\n\n<p>garagenplaner.com<br />\ngaragen-planer.com<br />\ngaragen-planung.de<br />\ngaplaner.de<br />\ngarplaner.de<br />\nhgplaner.de<br />\nhkplaner.de<br />\nibkplaner.de<br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n', 10, 1, 2, 1609974000, 1610060400, 1610045816),
(7, 'Auftrags-Pool', '<p><strong>Auftragspool</strong></p>\n\n<p><strong>Hier landen die Auftr&auml;ge.</strong></p>\n\n<p><s>Es sind noch die endg&uuml;ltige Definition der Karte und des Popups zu besprechen.</s></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Martin:</strong><br />\n<s>Lieferscheine programmieren. Es wird jeder Lieferschein extra erfasst. Auch wenn er f&uuml;r mehr als einen Auftrag gilt.</s></p>\n\n<p><s>Beim Popup muss es M&ouml;glichkeit geben, den Auftrag wieder zur&uuml;ck zu stellen.</s></p>\n\n<p><s>Auftrag kommt von dort in den Abrufpool</s></p>\n\n<p><br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Offene Punkte:</strong><br />\nWie kommen die Auftr&auml;ge vom WWP hier her?</p>\n\n<p><s>Endg&uuml;ltige Definition der Karten und Popups</s></p>\n\n<p>&nbsp;</p>\n', 20, 1, 4, 1609974000, 1610060400, 1610804160),
(8, 'Namen des Programms?', '<p>Welchen Namen geben wir dem programm? Sollte ev. noch vor der Domain kommen</p>\n\n<p>&nbsp;</p>\n', 10, 1, 2, 1609974000, 1610060400, 1610047626),
(9, 'Liste Beton ', '<p>Liste zum Ausdrucken.</p>\n\n<p>Beton, Lieferschein, Wetter an dem Tag usw</p>\n', 20, 6, 1, 1609974000, 1617141600, 1610047686),
(10, 'Abruf-Pool', '<p><strong>Abrufpool</strong></p>\n\n<p><strong>Hier landen die Auftr&auml;ge aus dem Auftrags-Pool.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Martin:</strong></p>\n\n<p>Das ist im Prinzip genau dasselbe wie im Auftragspool, aber Status 2</p>\n\n<p>Die Auftr&auml;ge k&ouml;nnen, wenn sie ein Auftragsdatum haben, automatisiert in die Schalungsplanung. Der Termin dort wird dann als FIX genommen<br />\nWichtig: Es muss beachtet werden ob an dem Tag bereits eine Garage eingeplant ist.<br />\nWenn ja, fragen ob verschieben oder anderer Tag anbieten.<br />\nIdee: Ev. nicht freie Termine im Kalender gleich als belegt anzeigen.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Offene Punkte:</strong><br />\n&nbsp;</p>\n', 20, 2, 3, 1609974000, 1610146800, 1610130972),
(11, 'Raspberry', '<p>Installation auf einem Raspberry pi IV</p>\n', 60, 4, 5, 1609974000, 1610578800, 1610388473),
(12, 'Planung Schalung', '<p><strong>Abrufpool</strong></p>\n\n<p><strong>Hier landen die Auftr&auml;ge aus dem Abruf-Pool.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Martin:</strong></p>\n\n<p><s>Samstag nur 1 Schalung, Zeile dann halb so hoch</s></p>\n\n<p><s>Feiertag auch nur halb so hoch.</s></p>\n\n<p>Umsetzung Garagen sperren - entsperren</p>\n\n<p><s>Fehler bei normalen sperren des Tages. Garagen werden kopiert (Ev. Fehler vorher beim vorher l&ouml;schen?)</s><br />\n&nbsp;</p>\n\n<p>Maximal Tage in der Vergangenheit:-&gt; es werde nur die Tage angezeigt, bis zu der noch Garagen da sind</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Offene Punkte:</strong><br />\nSoll sich der aktuelle Tag auch verschieben oder sperren lassen?</p>\n', 20, 3, 3, 1609974000, 1610233200, 1610789038),
(13, 'Karten und Popup', '<p>Endg&uuml;ltiges Design der Karten und des Popups</p>\n\n<p>&nbsp;</p>\n', 5, 1, 4, 1609974000, 1610060400, 1610628601),
(14, 'Bilderupload', '<p><img alt=\"\" src=\"http://www.hewede.de/garage/AdminCP/images/20200110_15101616.jpg\" style=\"height:1000px; width:1333px\" />Bilderupload f&uuml;r Projekte</p>\n', 11, 1, 5, 1610060400, 1610060400, 1610097444),
(15, 'Organigramm', '<p>Organigramm: Mache ich sp&auml;ter grafisch besser,</p>\n\n<p>Namen f&uuml;r die einzelnen Elemente noch finden:</p>\n\n<p>Alle Angaben IBK B&uuml; spezifisch. Gestaltung m&ouml;glichst offen damit es auch f&uuml;r andere Firmen nutzbar sein kann.</p>\n\n<p>&nbsp;</p>\n\n<p>Aus Warenwirtschaft oder manuell Daten erfassen</p>\n\n<p>in Karteikarte (Popup) in der alle relevanten Infos stehen Je nach Bereich k&ouml;nnen unterschiedliche Infos angezeigt werden.</p>\n\n<p>Alle die Daten sind relevant f&uuml;r die folgenden Punkte + Druck der Arbeitskarte + Anlegen Kundendienst + Etikettdruck f&uuml;r Warnschild + .....</p>\n\n<p>Auftragspool (Grafik ist fertig)</p>\n\n<p>Abrufpool (Grafik ist fertig)</p>\n\n<p>Produktionsplanung (frei verschiebbar) Grafik ist fertig (incl. Erfassung Wetter, Bestellmenge Beton, Uhrzeit, Lieferscheinnummer (Je 2 f&uuml;r Garage und Boden), Betonsorte ) + &Uuml;bergabe in Bestellformular und Wochenformular zu Ausdrucken. (6 Schalungen, unterschiedliche Farben, Mehrfachbelegung Schalung, Samstag Produktion m&ouml;glich aber nur 1 x)</p>\n\n<p>Zwischenlagerpool</p>\n\n<p>Bodenplanung (wie Produktionsplanung) (Schalungen)</p>\n\n<p>Zwischerlagerpool</p>\n\n<p>Ausbauhalle (12 Pl&auml;tze &uuml;berdachte) Funktionsweise &uuml;berlegen</p>\n\n<p>Auslieferungslager (Mit Ampel oder Statusinfo ob Garage fertig oder ob noch Tor, Elektro, Dachrand fehlt) Abgenommen und lieferf&auml;hig</p>\n\n<p>Auslieferungsplanung (Diefferenzierung nach eigenen Fahrzeugen, Speditionen, Kranmontage, Kundendienst notwendig)</p>\n\n<p>&nbsp;</p>\n\n<p>Transparenz des Produktionsprozesses, Optimierung der Abl&auml;ufe, Zeitersparnis in der Planung, weniger Papierverbrauch)</p>\n\n<p>Monteurplaner?</p>\n\n<p>tbc...</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 12, 2, 4, 1610060400, 1610233200, 1610095563),
(16, 'Liste alternative Produkte', '<p>Liste alternativer Produkte als Link:</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Manuell:</strong></p>\n\n<p>https://www.kaiserkraft.de/praesentationen/planungstafeln/t-kartenplaner-jahresplaner/12-module-mit-je-54-schlitzen/p/M53703/?articleNumber=985814&amp;utm_content=Presentations%3EPlanning-boards&amp;utm_term=985814&amp;customerType=B2C&amp;PC=1GOS&amp;storefront=current&amp;gclid=CjwKCAiAouD_BRBIEiwALhJH6CRdEjBOkWR4_dSuwaP3Xb4eiuv79v0YDPBk1DdmSJpq-s8VUig6ahoCSXkQAvD_BwE</p>\n\n<p>&nbsp;</p>\n\n<p>https://www.jh-profishop.de/Karten-Sortiertafel-Starter-Set-94654-194109/?gclid=CjwKCAiAouD_BRBIEiwALhJH6OlF9QjhdvoG-Bx82FRlMUgRxad0ErqVwpQAA3J1kMvgN8-NBLMzVhoCJT4QAvD_BwE&amp;Shop=b2c&amp;sd=true&amp;ef_id=CjwKCAiAouD_BRBIEiwALhJH6OlF9QjhdvoG-Bx82FRlMUgRxad0ErqVwpQAA3J1kMvgN8-NBLMzVhoCJT4QAvD_BwE:G:s&amp;s_kwcid=AL!8053!3!485715370725!!!u!297608266771!!11826306173!111764132061</p>\n\n<p>&nbsp;</p>\n\n<p>https://www.viking.de/de/legamaster-premium-plus-mehrzweckplaner-emailliert-magnetisch-90-x-60-cm-p-1037050?utm_source=google&amp;utm_medium=organic&amp;utm_campaign=surface_google&amp;cm_mmc=Google-_-PLA_GEN_GOOGLE-SHOPPING_praesentieren_GOSC-_-praesentieren-_-PRODUCT_GROUP&amp;gclid=CjwKCAiAouD_BRBIEiwALhJH6OzZ2q9ZdAy09zkC3MpZG03zGPTbXyed55XOsu6AJPkydgUWvA20GBoCDAkQAvD_BwE&amp;gclsrc=aw.ds</p>\n\n<p>&nbsp;</p>\n\n<p>https://www.schaefer-shop.de/p/streifen-stecktafel-visiplan-versch-ausfuehrungen?selectedItem=184052&amp;b2borb2c=1&amp;gshop=1&amp;cc=A065754&amp;gkw=&amp;track=v44*&amp;gclid=CjwKCAiAouD_BRBIEiwALhJH6Hzg_69H1BATwxfrcpfkI_bo3weXP7r9xQFAMBKpkeCOkTaEGGSCrxoCcL8QAvD_BwE</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Digital:</strong></p>\n\n<p>https://www.planungstafel.com/?gclid=CjwKCAiAouD_BRBIEiwALhJH6KWJ8CRtdvST6ZxPFXWJ_U-H8aZKnK_wxoMt5w86X8rgVidl3LwgKxoClfcQAvD_BwE</p>\n\n<p>https://www.mappe.de/2227-26planungstool-die-digitale-stecktafel</p>\n\n<p>https://www.monteurplaner.de/</p>\n\n<p><a href=\"https://www.monteurplaner.de/\">Monteurplan</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 50, 6, 4, 1610060400, 1610751600, 1610388566),
(17, 'Automatisches Update', '<p><s>Automatisches Update der Tafeln.</s></p>\n\n<p><s>Entweder &uuml;ber WebSocket oder notfalls &uuml;ber einen Seitenrefresh alle 5 Minuten.</s></p>\n\n<p><s>Das Problem wurde jetzt folgenderma&szlig;en gel&ouml;st:</s></p>\n\n<p><s>Eine Text-Datei wird in den Methoden&nbsp;TakeBack() und&nbsp;TakeOver() in der Classe AufAbPool() erzeugt. (Weitere Classen werden folgen).<br />\nDiese Methoden schreiben fortlaufend die Nummer der Spalte durch Komma getrennt in die Text-Dateien.<br />\nDie Text-Datei besteht aus der Seiten ID und .txt. Also erste Seite 1.txt, zweite Seite 2.txt usw. und werden im Verzeichnis ./includes/files/ gespeichert.</s></p>\n\n<p><s>Der Browser schaut dann alle X Sekunden auf dem Server nach, ob die Datei vorhanden ist. Wenn ja, gibt der Server sie zur&uuml;ck.</s></p>\n\n<p><s>Der Browser wertet sie dann aus und refreshed die entsprechende Spalte.</s></p>\n\n<p>Leider geht das so nicht, da so ja nur ein Browser refreshed wird.</p>\n\n<p><s>Es wurde jetzt so umgesetzt:</s></p>\n\n<p><s>Es wird jeder bei jeder &Auml;nderung, die den anderen Clients bekannt werden soll ein Datensatz mit der Seite = status und der Stelle = Schalung und lastdate = uxtime<br />\nin eine extra Tabelle autoupdate geschrieben.</s></p>\n\n<p><s>Der Browser schaut dann alle X Sekunden auf dem Server nach, ob der timestamp f&uuml;r ihn &auml;lter ist.<br />\nWenn ja, gibt er Seite und Stelle zur&uuml;ck</s></p>\n\n<p><s>Der Browser wertet sie dann aus und refreshed die entsprechende Spalte.</s></p>\n\n<p>N&auml;chster Versuch..</p>\n\n<p>Der Browser schickt einfach eine Liste aller ID&#39; mit Komma getrennt. Auf dem Server wird dann nachgeschaut, ob die Reinfolge und ID&#39; stimmen.(als MD5)</p>\n\n<p>Ev. muss ich doch einfach in regelem&auml;&szlig;igen Abst&auml;nden jede Spalte refreshen, da aktuell nicht alle Updates erkannt werden.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 11, 1, 3, 1610060400, 1610406000, 1611321961),
(18, 'kopieren der Garagen', '<p>Eine Garage bekommt aus dem WWP nur die Anzahl der Garagen als Endung /X</p>\n\n<p>Ich muss diese dann kopieren, dabei kann die Anzahl vorgegeben werden. Vorgeschlagen wird X</p>\n\n<p>Es muss beim &uuml;bernehmen vom Auftragspool in den Abrufpool gepr&uuml;ft werden, ob auch alle Garagen angelegt worden sind. Sonst darf keine &Uuml;bernahme erfolgen.<br />\nAu&szlig;er man kann auch im Auftragspool kopieren.</p>\n', 11, 1, 5, 1610060400, 1610146800, 1610213259),
(19, 'Fragen', '<p>Fragen:</p>\n\n<ul>\n	<li>Wann darf eine Garage gel&ouml;scht werden? Also wie lange? Nach dem Abruf eigentlich nicht mehr, oder?<br />\n	&nbsp;</li>\n	<li>&Uuml;berschriften bei Auftragspool:<br />\n	Arnold wollte, dass man es Auftrag anlegen nennt. Aber eigentlich lege ich hier Garagen an, keine Auftr&auml;ge. Jede Karte sollte eigentlich eine einzelne Garage sein, wenn sie in den Abrufpool &uuml;bernommen wird.<br />\n	Ich habe jetzt erst mal eine &Uuml;berschrift eingef&uuml;gt..<br />\n	&nbsp;</li>\n	<li>Gleich n&auml;chste Frage: Kopieren einer Garage nur im Auftragspool, oder?</li>\n	<li><span style=\"color:#2980b9\">Eigentlich ja. Ich w&uuml;sste keinen Fall das danach noch weitere Garagen erg&auml;nzt werden.</span><br />\n	&nbsp;</li>\n	<li>Muss ich beim &uuml;bernehmen in den Abrufpool &uuml;berpr&uuml;fen, ob die Garagen kopiert wurden?<br />\n	(Ich lasse jetzt einen Abruf nur zu, wenn alle Garagenkopiert wurden, also angelegt wurden.</li>\n	<li><span style=\"color:#3498db\">Wenn es einfach funktioniert w&auml;re eine Plausibilit&auml;tspr&uuml;fung genial. D.h. bei einem Auftrag mit 15 Garagen und nur 10 Kopien meldet sich die &quot;Masterkarte&quot; sp&auml;testens beim Verschieben in den Produktionspool das noch nicht alle kopiert wurden. Bei gr&ouml;&szlig;eren Auftr&auml;gen kommt es immer wieder vor, dass Blockweise abgerufen wird. Aber eigentlich sollten bereits im Auftragspool alle Karten des Auftrags liegen. Wann die Meldung kommt ist eigentlich egal.</span><br />\n	&nbsp;</li>\n	<li>Wann kommt eine Garage in den Boden-Pool? Automatisch nach einem Tag oder manuell? Was ist wenn sie vergessen wird?</li>\n	<li><span style=\"color:#2980b9\">Am liebsten mit Klick auf den Pfeil. Dann ist der Pfeil in allen Ebenen gleich belegt.</span><br />\n	&nbsp;</li>\n	<li>Wie lange muss der Planung Produktion r&uuml;ckwirkend angezeigt werden k&ouml;nnen?<br />\n	Es werden nur die Tage angezeigt, an der noch Garagen da sind. In der Regel ist das dann der aktuelle Tag.</li>\n	<li><span style=\"color:#3498db\"><em>Damit wir von Gleichen reden: Wie lange muss die Steckkarte in der&nbsp; Produktionsplanung angezeigt werden. Am Ende de Produktionswoche sollten die Daten wie in das Excelblatt</em> &uuml;bergeben werden. Muss aber nicht Excel sein. Nur die gleiche Optik und das Ausdruckbar f&uuml;r die Fremd&uuml;berwachung.Wenn die Wochenplanung tranferiert wurde k&ouml;nnen&nbsp; die Daten raus. Gleiches gilt auch f&uuml;r die Auslieferungsplanung. Diese Formulare muss ich noch vorbereiten.</span></li>\n</ul>\n', 10, 1, 4, 1610060400, 1617141600, 1610389318),
(20, 'Titel der Seiten', '<p>Den ganzen Seiten den richtigen Title geben</p>\n', 11, 1, 5, 1610319600, 1610406000, 1610457279),
(21, 'Bilder suchen', '<p>Hintergrund Bilder</p>\n', 12, 3, 1, 1610406000, 1611270000, 1610457548),
(22, 'Produktion', '', 5, 4, 2, 1610492400, 1611270000, 1610526504),
(23, 'Auslieferung', '<table cellspacing=\"0\" style=\"border-collapse:collapse; height:127px; width:827px\">\n	<tbody>\n		<tr>\n			<td colspan=\"3\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:20px; vertical-align:bottom; white-space:nowrap; width:240px\"><span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\">Fahrzeug= MAN, Volvo, Scania, Sonst.</span></span></span></td>\n			<td colspan=\"4\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap; width:320px\"><span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\">Fahrer: Cherdak, Maier, Berger, Sonstige</span></span></span></td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap; width:320px\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:8px; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:20px; vertical-align:bottom; white-space:nowrap\"><span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\">Spedition:</span></span></span></td>\n			<td colspan=\"4\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\"><span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\">Kn&ouml;bel, Welz, Claude, Bourgois, Sonstige</span></span></span></td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:8px; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:20px; vertical-align:bottom; white-space:nowrap\">&nbsp;</td>\n			<td colspan=\"6\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:20px; vertical-align:bottom; white-space:nowrap; width:480px\"><span style=\"font-size:15px\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\">Seitliche Versetzung nur bei MAN und nur wenn Garagengewicht&nbsp; &lt; 14,0 to</span></span></span></td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" style=\"border-bottom:none; border-left:none; border-right:none; border-top:none; height:20px; vertical-align:bottom', 5, 4, 2, 1610492400, 1611270000, 1610526496),
(24, 'Automatismen', '<p>Welche Automatismen soll es geben:</p>\n\n<ul>\n	<li><s>Gewicht des Betons einer Schalung zusammen rechnen</s></li>\n	<li><s>Wenn Garage Attribut Seite, darf Beton nicht &uuml;ber (14) Tonnen ein. Als LKW kommt dann nur der MAN in Betracht (Nur das Fahrzeug, das in der Spalte Seite auch dieses Gewicht tragen kann</s><br />\n	<s>Wenn mehr Gewicht eingetragen wird, muss eine Fehlermeldung kommen.</s></li>\n	<li><u>Wenn Auftragsdatum eingetragen wird, wird der Auftrag automatisch an dem Tag als Fixtermin &uuml;bernommen-&gt; das laut Arnold nicht</u><br />\n	<s>Das Lieferdatum wird auf 14 Tage sp&auml;ter gesetzt (Feiertage ber&uuml;cksichtigen).</s></li>\n	<li><s>Wenn eine Lieferdatum eingetragen wird, wird automatisch 14 Tage vorher ein Auftragsdatum eingetragen</s></li>\n	<li><s>Wenn eine Garage eine Abruftermin bekommt und nicht weiter geleitet wird, kommt ein Popup mittags um 12. Ebenso einen Tag sp&auml;ter im Abrufpool..</s></li>\n	<li><s>Soll man die ganzen Datumsfelder auf Plausibilit&auml;t &uuml;berpr&uuml;fen?<br />\n	Dass sie z.B. nicht in der Vergangenheit liegen, nicht vor oder nach anderen Terminen..</s></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>Neuer Ansatz:</p>\n\n<ul>\n	<li>&Uuml;bernahme in die Produktion<br />\n	Die Garagen werden vom Abrufpool manuell &uuml;ber das Datumsfeld Produktion in die Planung &uuml;bernommen. Sie m&uuml;ssen dann manuell, aber sicher, in die Produktion &uuml;bertragen werden.<br />\n	Dazu wird, wenn das Datum eingetragen ist, unten der &Uuml;bernahmepfeil eingeblendet. Falls das Stammblatt so geschlossen wird, kommt eine Popup-Fehlermeldung. (entweder &uuml;bernehmen in Produktion oder Datum l&ouml;schen)<br />\n	Falls da trotzdem mal was schief geht weil z.B. der Browser geschlossen wird, kommt beim &Ouml;ffnen des Abruf-Pools eine entsprechende Popup-Meldung.<br />\n	--&gt; Darf es dann bereits Auftrags-Pool m&ouml;glich sein, ein Produktionsdatum einzutragen? Eigentlich nicht, man umgeht ja dann den Abrufpool. Wobei das ja auch kein Problem w&auml;re. <span style=\"color:#e74c3c\">Darf nicht m&ouml;glich sein.</span><br />\n	Weitere Frage: Soll &uuml;berpr&uuml;ft werden, ob bestimmte Felder belegt sind? Sonst darf keinen &Uuml;bernahme erfolgen. <span style=\"color:#e74c3c\">Kommt sp&auml;ter, Fehlerauswertung</span><br />\n	&nbsp;</li>\n	<li>Produktion Tage sperren und Garagen verschieben<br />\n	(Ich bin mir noch nicht sicher was da die beste Methode ist.)<br />\n	<br />\n	<u>Was passiert wenn ich einen Tag sperre? </u><br />\n	1. Die Garagen verschieben sich ab da nach unten, gefixte Garagen bleiben fix. --&gt;Da gibt es keine Alternative<br />\n	<br />\n	<u>Was passiert wenn ich einen Tag frei gebe? </u><br />\n	1. Die Garagen verschieben sich wie oben. Nachteil: Der Platz wird nicht frei gehalten, aber daf&uuml;r Automatismus..<br />\n	2. Der Platz wird frei gehalten. Es kann so eine Garage einfach eingef&uuml;gt werden, das Verschieben per Drag and Drop w&uuml;rde sich er&uuml;brigen.<br />\n	&nbsp;&nbsp; Um eine Garage an einen anderen Platz zu schieben sperrt man den Platz, gibt ihn wieder frei und schiebt die Garage dort hin.<br />\n	&nbsp;&nbsp;<span style=\"background-color:#f39c12\"> (Merker f&uuml;r mich: Ich muss das Datum immer auch in allen Garagen (</span><span style=\"background-color:#f39c12\">datump</span><span style=\"background-color:#f39c12\">) beim sperren oder freischalten nachziehen!! Auch die Auslieferung???) </span><br />\n	&nbsp;&nbsp;&nbsp; Man h&auml;tte so besser im Griff was passiert. Allerdings ist dann eine L&uuml;cke, wenn man sperrt und frei schaltet<br />\n	&nbsp;&nbsp;&nbsp; --&gt; Man k&ouml;nnt dann einen Automatismus machen, der manuell angtriggert wird.<br />\n	<br />\n	<u>Wie schiebe ich am besten eine Garage?</u><br />\n	Wenn wir das so wie oben machen er&uuml;brigt es sich..<br />\n	<br />\n	&nbsp;</li>\n	<li>Datumfelder Termine sperren:<br />\n	1. Ich k&ouml;nnte noch Termine sperren. Auslieferungstermine? Auch Sa oder So?<br />\n	2 .Termin Auslieferung alle Tage in der Vergangenheit sperren. --&gt; Da muss ich jeden Tag einzeln sperren wegen Uhrzeit.<br />\n	3. Datum Uhrzeit Rezept? --&gt; Ist eigentlich eher unwichtig ob alles angezeigt wird...<br />\n	&nbsp;</li>\n</ul>\n', 5, 1, 4, 1610492400, 1612047600, 1611240155),
(25, 'Wetter', '<p>Anzeige der Wetterdaten im Admin</p>\n\n<p>M&ouml;glichkeit sich Wetterdaten nachtr&auml;glich noch zu holen</p>\n', 11, 4, 1, 1610492400, 1611961200, 1610570894),
(26, 'Hilfe', '<p>Hilfe f&uuml;r den Adminbereich. Es sollte f&uuml;r alles ein Hilfethema geben. Die wichtigen fange ich immer gleich an..</p>\n', 10, 1, 4, 1610665200, 1617141600, 1610727442),
(27, 'Refresh Button', '<p>Auf jeder Seite ein Refresh-Button, um die Seite notfalls manuell zu refreshen</p>\n', 11, 1, 5, 1610665200, 1610751600, 1610788665),
(28, 'Produktionskarte', '<p>Muster am 16.01.2021 an Martin gemailt.</p>\n\n<p>Es gibt 6 verschiedene, wobei sich nur das Bild in der Mitte &auml;ndert.</p>\n\n<p>Kopf und der untere Bereich sind identisch.</p>\n\n<p>Kopf w&auml;re wichtig und zeitsparend die Infos vom Stammblatt zu &uuml;bernehmen.</p>\n\n<p>Der untere Bereich zum Anklicken w&auml;re nett aber nicht notwendig. Je nach Arbeitsaufwand.</p>\n\n<p>F&uuml;r AK. Bei &Ouml;ffnungen k&ouml;nnten verschiedene Formulare angezogen werden. Noch mit Martin besprechen.</p>\n', 10, 3, 1, 1610751600, 1613084400, 1610791190),
(29, 'QR Code drucken', '<p><strong>Das geht leider nur, wenn das Tool im Internet ist</strong></p>\n\n<p>Aufkleber mit QR Code und weiteren Informationen drucken:</p>\n\n<p>&nbsp;</p>\n\n<p>Grundinfo:</p>\n\n<p>AB-Nr.; Kundenname, Baustellenadresse, Produktionsdatum</p>\n\n<p>und weitere Normnotwendige Infos</p>\n\n<p>&nbsp;</p>\n\n<p>QR Code:</p>\n\n<p>z.B. Arbeitskarte ausgef&uuml;llt.</p>\n', 1, 5, 9, 1610751600, 1614380400, 1610966220),
(30, 'Arbeitskarte', '<p>Den Plan der Garage zeichnen und nicht als jpg einbinden</p>\n\n<p>M&ouml;glichkeit um Fenster und T&uuml;ren im Plan einzuzeichnen.</p>\n\n<p>Abmessungen und Position als Paramter &uuml;bergeben<br />\nFenster: H&ouml;he: 85, Breite: 104, Oberkante 210, Entfernung von hinten<br />\n&nbsp;</p>\n', 11, 3, 4, 1611183600, 1612047600, 1611997910),
(31, 'Datenimport aus IFW', '<p>Welche Daten ben&ouml;tigen wir aus dem IFW?</p>\n\n<p>Auftragsnummer<br />\nName<br />\nTyp (Schalung)<br />\nBauart<br />\nBaustelle (Standort und Telefonnumer)<br />\n.....</p>\n\n<p>...</p>\n', 5, 2, 2, 1611270000, 1611874800, 1611323091),
(32, 'Arbeitskarte', '<p>&Auml;nderungsw&uuml;nsche an die Arbeitskarte wenn wir nichts mehr zu haben:</p>\n\n<p>- Attika abgeschalt</p>\n\n<p>- R&uuml;ckseite Arbeitskarte Formular zur Zeiterfassung der einzelnen Arbeitsschritte</p>\n\n<p>- Sammenentw&auml;sserung</p>\n\n<p>- Entfall L&uuml;ftungs&ouml;ffnungen</p>\n\n<p>- Dachl&uuml;fter</p>\n\n<p>&nbsp;</p>\n', 40, 6, 1, 1613948400, 0, 1614012178);
